    const[password, setPassword] = useState("");

    const onSubmit = (event) =>{
        event.preventDefault();
        UserPool.signUp(email, password,[],null,(err,data)=>{
            if(err){
                console.error(err);
                return "err.message";
            }
            console.log(data);
        }
        );
    };

